import React from "react";

import "./MainHeader.css";

const MainHeader = () => {

    return(
        <header>
            <div className="header_blog_icon">아이콘자리
            </div>
            <div className="header_main_title">Yoosh & MaeM</div>
        </header>
    );

}

export default MainHeader;
